    totalOrdersThisMonth: 0,
    totalOrdersInProgress: 0,
    revenue: 0,
    expectedRevenue: 0,
    recentOrders: []
}

export function Dashboard() {

    const [metrics, setMetrics] = useState(defaultMetrics);
    useEffect(() => {
        axios.get('/dashboard').then(res => setMetrics(res.data));
    }, []);
    return metrics.totalOrders;
}

